import Crew from './components/crewPage.js'
import Destination from './components/destinationPage.js'
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

function App() {
  return (
    <div>
    <Navbar/>
    <Landing/>
    <Crew/>
